import React from 'react';
import styles from './RemedyDetails.module.css'

const RemedyDetails = ({ remedyData }) => {

    const search = (data, key, value) => {

        return data.filter(item => item[key].toLowerCase());
      };

    const whatToEatSearchResult = this.search(remedyData["What to eat"], "Food", "Rice");
    const howToPrepareItSearchResult = this.search(remedyData["How to prepare it"], "Food", "Chicken soup");
    const whenToEatSearchResult = this.search(remedyData["When to eat"], "Time", "Breakfast");
  

      return (
        <div>
          <h1>{remedyData.Diagnosis}</h1>
          <h2>What to eat:</h2>
          <ul>
            {whatToEatSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Food}:</strong> {item.Reason}
              </li>
            ))}
          </ul>
          
          <h2>How to prepare it:</h2>
          <ul>
            {howToPrepareItSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Food}:</strong> {item.Preparation}
              </li>
            ))}
          </ul>
  
          <h2>When to eat:</h2>
          <ul>
            {whenToEatSearchResult.map((item, index) => (
              <li key={index}>
                <strong>{item.Time}:</strong> {item.Meal}
              </li>
            ))}
          </ul>
        </div>
      );
};

export default RemedyDetails;
